import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Page2.css';

export default function MenuPage() {
  const navigate = useNavigate();

  const menuItems = [
    "Introduction to cyber safety",
    "Passwords",
    "Socially engineered attacks",
    "Data security risks",
    "Your responsibilities",
    "More information",
  ];

  const handleItemClick = (index) => {
    if (index === 0) {
      navigate('/video'); // Navigate to the VideoPage
    }
    // Handle other menu item clicks if needed
  };

  return (
    <div className="menu-container">
      <nav className="navbar navbar-expand-lg d-flex justify-content-between align-items-center mb-5">
          {/* Left side content */}
          <div className="d-flex align-items-center">
            <a className="loggg navbar-brand p-2 fs-4 text-white" href="#">Your Logo</a>
          </div>

          {/* Right side content */}
          <div className="d-flex align-items-center">
          <div className="text-center mx-2">
            <img src="mute.jpg" className="img-btn btn rounded-circle" alt="Mute" />
            <p className="mt-2 text-white">mute</p>
          </div>
          <div className="text-center mx-2">
            <img src="exit.jpg" className="img-btn btn rounded-circle" alt="Exit" />
            <p className="mt-2 text-white">exit</p>
          </div>
        </div>
        </nav>
      <div className="menu-list">
        {menuItems.map((item, index) => (
          <div
            key={index}
            className={`menu-item ${index === 0 ? 'active' : ''}`}
            onClick={() => handleItemClick(index)} // Add onClick handler
          >
            <div className="menu-item-text">{index + 1}. {item}</div>
            <div className="menu-item-icon">âž”</div>
          </div>
        ))}
      </div>
    </div>
  );
}
